import Footer from '../components/Footer/Footer'

export default class RefundPage extends Component {
    componentDidMount() {
        window.scroll(0,0)
    }
    render() {
        return (
            <Fragment>
                <TopNavigation title="Refund Policy"/>
                <PageTop pagetitle="Refund Policy"/>
                <RefundDescription/>
                <Footer/>
            </Fragment>
        )
    }
}
